	private static int chargeDay(int i, int j, int k) {
		if((i % 100 == 0 && i % 400 ==0) || (i % 100 != 0 && i % 4 == 0)){
			if(j == 2 && k == 29){
				return i * 10000 + 300 + 1;
			}
		}else if(j == 2 && k == 28){
			return i * 10000 + 300 + 1;
		}
		if(nums.contains(j)){
			if(k == 31){
				return i * 10000 + (j + 1) * 100 + 1;
			}
		}else if(k == 30){
			return i * 10000 + (j + 1) * 100 + 1;
		}
		return i * 10000 + j * 100 + k + 1;
	}
